import React, { useEffect } from "react";
import { connect } from "react-redux";
import { getQuestionList } from "../actions/getQuestionList";

const GamePage = ({ getQuestionList, difficulty }) => {
  useEffect(() => {
    getQuestionList(difficulty.level);
  });

  return (
    <div className="game-page">
      <div className="game-content"></div>
    </div>
  );
};

const mapStateToProps = (state) => {
  return state;
};

export default connect(mapStateToProps, { getQuestionList })(GamePage);
